import React from "react";
import Link from "next/link";

const Nav = ({ categories }) => {
  const classes = useStyles();

  return (
    <div>
      {categories.map((category) => {
        return (
          <Link
            key={category.id}
            as={`/category/${category.id}`}
            href="/category/[id]"
          >
            <Button>{category.name}</Button>
          </Link>
        );
      })}
    </div>
  );
};

export default Nav;
